import React from "react";
import '../stylesheets/AddWine.css';

function AddWine () {
  return (
    <div className="addWine">
      <h2>Add more Wine</h2>

      <form class="needs-validation " novalidate>
        <div class="row d-flex justify-content-around">
          <div class="col-md-4 mb-3">
            <label for="validationCustom01">Name</label>
            <input type="text" class="form-control" id="validationCustom01" placeholder="Name" required />
            <div class="valid-feedback">
              Looks good!
            </div>
          </div>
          <div class="col-md-4 mb-3">
            <label for="validationCustom02">Winery</label>
            <input type="text" class="form-control" id="validationCustom02" placeholder="Winery"  required />
            <div class="valid-feedback">
              Looks good!
            </div>
          </div>
        </div>
        <div class="row d-flex justify-content-around">
          <div class="col-md-4 mb-3">
            <label for="validationCustom03">Year</label>
            <input type="text" class="form-control" id="validationCustom03" placeholder="Year"/>
          </div>
          <div class="col-md-4 mb-3">
            <label for="validationCustom04">Variety</label>
            <input type="text" class="form-control" id="validationCustom04" placeholder="Variety" />
          </div>
          <div class="col-md-4 mb-3">
            <label for="validationCustom04">Region</label>
            <input type="text" class="form-control" id="validationCustom04" placeholder="Region" />
          </div>

        </div>
        <div class="row">
          <div class="col-md-4 mb-5">
            <label for="validationCustom02">Description</label>
            <input type="text" class="form-control" id="validationCustom02" placeholder="Description" />
            <div class="valid-feedback">
              Looks good!
            </div>
          </div>
          <div class="col-md-4 mb-3 custom-file">
            <input type="file" class="custom-file-input" id="customFile"/>
            <label class="custom-file-label" for="customFile">Choose file</label>
          </div>
        </div>
        <button class="btn btn-primary" type="submit">Submit form</button>
      </form>
    </div>
  );
}

export default AddWine;





